import React, { useState } from 'react';
import { supabase } from '../supabaseClient';
import { useNavigate } from 'react-router-dom';
import { Mail, Lock, User, ArrowRight } from 'lucide-react';

const AuthPage = () => {
  const [isSignUp, setIsSignUp] = useState(false);
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const navigate = useNavigate();

  const handleAuth = async (e) => {
    e.preventDefault();
    setLoading(true);

    if (isSignUp) {
      const { error } = await supabase.auth.signUp({ email, password });
      if (error) alert(error.message);
      else alert('Success! Check your email for a confirmation link.');
    } else {
      const { error } = await supabase.auth.signInWithPassword({ email, password });
      if (error) alert(error.message);
      else navigate('/');
    }
    setLoading(false);
  };

  return (
    <div style={container}>
      <div style={authCard}>
        <h2 style={title}>{isSignUp ? 'Create MegaMart Account' : 'Welcome Back'}</h2>
        <p style={subtitle}>Join Rwanda's favorite gadget store.</p>

        <form onSubmit={handleAuth} style={form}>
          <div style={inputGroup}>
            <label style={label}>Email Address</label>
            <div style={inputWrapper}>
              <Mail size={18} color="#888" />
              <input 
                type="email" 
                placeholder="email@example.com" 
                style={input} 
                value={email} 
                onChange={(e) => setEmail(e.target.value)} 
                required 
              />
            </div>
          </div>

          <div style={inputGroup}>
            <label style={label}>Password</label>
            <div style={inputWrapper}>
              <Lock size={18} color="#888" />
              <input 
                type="password" 
                placeholder="••••••••" 
                style={input} 
                value={password} 
                onChange={(e) => setPassword(e.target.value)} 
                required 
              />
            </div>
          </div>

          <button type="submit" style={submitBtn} disabled={loading}>
            {loading ? 'Processing...' : (isSignUp ? 'Sign Up' : 'Sign In')}
            <ArrowRight size={18} />
          </button>
        </form>

        <p style={toggleText}>
          {isSignUp ? 'Already have an account?' : "Don't have an account?"}
          <span style={toggleLink} onClick={() => setIsSignUp(!isSignUp)}>
            {isSignUp ? ' Sign In' : ' Create Account'}
          </span>
        </p>
      </div>
    </div>
  );
};

// --- STYLES ---
const container = { display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '80vh', backgroundColor: '#f4f4f4', padding: '20px' };
const authCard = { backgroundColor: '#fff', padding: '40px', borderRadius: '12px', boxShadow: '0 4px 20px rgba(0,0,0,0.08)', width: '100%', maxWidth: '400px' };
const title = { fontSize: '24px', fontWeight: 'bold', marginBottom: '8px', textAlign: 'center' };
const subtitle = { fontSize: '14px', color: '#666', textAlign: 'center', marginBottom: '30px' };
const form = { display: 'flex', flexDirection: 'column', gap: '20px' };
const inputGroup = { display: 'flex', flexDirection: 'column', gap: '8px' };
const label = { fontSize: '13px', fontWeight: '600', color: '#333' };
const inputWrapper = { display: 'flex', alignItems: 'center', gap: '10px', padding: '12px', border: '1px solid #ddd', borderRadius: '8px' };
const input = { border: 'none', outline: 'none', width: '100%', fontSize: '14px' };
const submitBtn = { backgroundColor: '#008ECC', color: 'white', border: 'none', padding: '14px', borderRadius: '8px', cursor: 'pointer', fontWeight: 'bold', display: 'flex', justifyContent: 'center', alignItems: 'center', gap: '10px', fontSize: '16px' };
const toggleText = { textAlign: 'center', marginTop: '20px', fontSize: '14px', color: '#555' };
const toggleLink = { color: '#008ECC', cursor: 'pointer', fontWeight: 'bold' };

export default AuthPage;
